import ExpenseItem from "./ExpenseItem";

function Expenses({_, title, amount, date}){

    return (
        <>
          <h2>Let's get started!</h2>
    
          <ExpenseItem
            title={title.title}
            amount={amount}
            date={date}
          ></ExpenseItem>
    
          <ExpenseItem
            title={title}
            amount={amount}
            date={date}
          ></ExpenseItem>
    
          <ExpenseItem
            title={title}
            amount={amount}
            date={date}
          ></ExpenseItem>
    
          <ExpenseItem
            title={title}
            amount={amount}
            date={date}
          ></ExpenseItem>
    
    <ExpenseItem
            title={title}
            amount={amount}
            date={date}
          ></ExpenseItem>
    
        </>
      );
}

export default Expenses;
